import { useEffect, useState } from "react";
import Table from "react-bootstrap/Table";

export default function Product() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch("/api/Domain/Product")
      .then((res) => res.json())
      .then((res) => {
        setData(res);
      });
  }, []);

  return (
    <div>
      <h1>Products:</h1>
      <Table striped bordered hover variant="dark">
        <thead>
          <tr>
            <th>#</th>
            <th>Name</th>
            <th>Count protein</th>
            <th>Count fat</th>
            <th>Count uglevod</th>
          </tr>
        </thead>
        <tbody>
          {data.map((post) => {
            return (
              <tr>
                <td color="green">{post.productId}</td>
                <td>{post.name}</td>
                <td>{post.countProtein}</td>
                <td>{post.countFat}</td>
                <td>{post.countUgl}</td>
              </tr>
            );
          })}
        </tbody>
      </Table>
    </div>
  );
}
